import React from "react";
// import { Parallax } from "react-scroll-parallax";
import {
  ContactContainer,
  ContactInner,
  ContactEmail,
  ContactLinkedIn,
  ContactInstagram,
  Detail,
  Image,
} from "./ContactElements";
import Daruma from "../../images/Daruma.png";

const Contact = () => {
  return (
    <ContactContainer id="contact">
      <ContactInner>
        <ContactEmail>
          <Detail>
            {" "}
            <a
              className="link"
              target="_blank"
              href="mailto:hashirizaki61@gmail.com"
            >
              email
            </a>
          </Detail>
        </ContactEmail>
        <ContactLinkedIn>
          <Detail></Detail>
        </ContactLinkedIn>
        <ContactInstagram>
          <Detail></Detail>
        </ContactInstagram>
      </ContactInner>
    </ContactContainer>
  );
};

export default Contact;
